import{_ as t,c as o,o as r,aj as a}from"./chunks/framework.DRmbE9yB.js";const u=JSON.parse('{"title":"ü§ñ AI","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/field-types/ai.md","filePath":"documentation/field-types/ai.md","lastUpdated":0}'),i={name:"documentation/field-types/ai.md"};function l(n,e,s,d,p,c){return r(),o("div",null,[...e[0]||(e[0]=[a(`<h1 id="ü§ñ-ai" tabindex="-1">ü§ñ AI <a class="header-anchor" href="#ü§ñ-ai" aria-label="Permalink to ‚Äúü§ñ AI‚Äù">‚Äã</a></h1><p>Generate AI-powered responses using prompts and automatically fill the output into form elements.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to ‚ÄúOverview‚Äù">‚Äã</a></h2><p>The AI field type allows you to provide a prompt to an AI model (Google Gemini or OpenRouter) and automatically fill the generated response into a specified form element. This is useful for generating dynamic content, creating text based on context, or getting AI assistance for form filling.</p><h2 id="how-it-works" tabindex="-1">How It Works <a class="header-anchor" href="#how-it-works" aria-label="Permalink to ‚ÄúHow It Works‚Äù">‚Äã</a></h2><ol><li><strong>Provide a Prompt</strong> - Define what you want the AI to generate</li><li><strong>AI Processes</strong> - The AI model generates a response based on your prompt</li><li><strong>Auto-Fill Output</strong> - The AI response is automatically filled into the target form element</li></ol><h2 id="configuration-options" tabindex="-1">Configuration Options <a class="header-anchor" href="#configuration-options" aria-label="Permalink to ‚ÄúConfiguration Options‚Äù">‚Äã</a></h2><h3 id="ai-provider-name" tabindex="-1">AI Provider Name <a class="header-anchor" href="#ai-provider-name" aria-label="Permalink to ‚ÄúAI Provider Name‚Äù">‚Äã</a></h3><p>Select your AI service provider from the dropdown.</p><p><strong>Available Providers:</strong></p><ul><li><strong>Google - Gemini API</strong> - Google&#39;s Gemini AI models</li><li><strong>OpenRouter</strong> - Access to multiple AI models through OpenRouter</li></ul><h3 id="api-key" tabindex="-1">API Key <a class="header-anchor" href="#api-key" aria-label="Permalink to ‚ÄúAPI Key‚Äù">‚Äã</a></h3><p>Enter your API key for the selected AI provider.</p><div class="tip custom-block"><p class="custom-block-title">How to Create API Key</p><ul><li><strong>Google Gemini API</strong>: Visit <a href="https://aistudio.google.com/" target="_blank" rel="noreferrer">Google AI Studio</a> to create your API key</li><li><strong>OpenRouter</strong>: Visit <a href="https://openrouter.ai/" target="_blank" rel="noreferrer">OpenRouter</a> to create your API key and get model names</li></ul></div><h3 id="ai-model-name" tabindex="-1">AI Model Name <a class="header-anchor" href="#ai-model-name" aria-label="Permalink to ‚ÄúAI Model Name‚Äù">‚Äã</a></h3><p>Specify the AI model you want to use.</p><p><strong>Examples:</strong></p><ul><li>Google Gemini: <code>gemini-pro</code>, <code>gemini-1.5-flash</code>, <code>gemini-1.5-pro</code></li><li>OpenRouter: Various models available (check OpenRouter documentation)</li></ul><h3 id="retry-on-error" tabindex="-1">Retry on Error <a class="header-anchor" href="#retry-on-error" aria-label="Permalink to ‚ÄúRetry on Error‚Äù">‚Äã</a></h3><p>Enable this switch to automatically retry the AI request if an error occurs.</p><p><strong>Options:</strong></p><ul><li><strong>ON</strong> - Retry on error</li><li><strong>OFF</strong> - Don&#39;t retry on error</li></ul><h2 id="setting-up-ai-prompts" tabindex="-1">Setting Up AI Prompts <a class="header-anchor" href="#setting-up-ai-prompts" aria-label="Permalink to ‚ÄúSetting Up AI Prompts‚Äù">‚Äã</a></h2><p>You can provide AI prompts in two ways:</p><h3 id="method-1-default-value-field" tabindex="-1">Method 1: Default Value Field <a class="header-anchor" href="#method-1-default-value-field" aria-label="Permalink to ‚ÄúMethod 1: Default Value Field‚Äù">‚Äã</a></h3><p>Use the <strong>&quot;If excel column value is empty then fill this default value&quot;</strong> option to set your AI prompt.</p><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Generate a professional email subject line for a job application</span></span></code></pre></div><h3 id="method-2-excel-column" tabindex="-1">Method 2: Excel Column <a class="header-anchor" href="#method-2-excel-column" aria-label="Permalink to ‚ÄúMethod 2: Excel Column‚Äù">‚Äã</a></h3><p>Store your prompts directly in an Excel column and reference it in the field value.</p><p><strong>Example Excel Column:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Write a product description for {productName}</span></span>
<span class="line"><span>Summarize this text: {articleContent}</span></span>
<span class="line"><span>Generate 5 hashtags for {topic}</span></span></code></pre></div><h2 id="filling-ai-output" tabindex="-1">Filling AI Output <a class="header-anchor" href="#filling-ai-output" aria-label="Permalink to ‚ÄúFilling AI Output‚Äù">‚Äã</a></h2><p>To specify where the AI output should be filled:</p><ol><li><strong>Copy the form field selector query</strong> from the target element</li><li><strong>Paste it in the Field Selector Query</strong> option</li><li>The AI response will automatically fill into that element</li></ol><p><strong>Example:</strong></p><ul><li><strong>Field Selector Query</strong>: <code>#description</code> or <code>.product-summary</code></li><li>AI output will be filled into the element matching this selector</li></ul><h2 id="practical-examples" tabindex="-1">Practical Examples <a class="header-anchor" href="#practical-examples" aria-label="Permalink to ‚ÄúPractical Examples‚Äù">‚Äã</a></h2><h3 id="example-1-generate-product-description" tabindex="-1">Example 1: Generate Product Description <a class="header-anchor" href="#example-1-generate-product-description" aria-label="Permalink to ‚ÄúExample 1: Generate Product Description‚Äù">‚Äã</a></h3><p><strong>Configuration:</strong></p><ul><li><strong>AI Provider</strong>: Google - Gemini API</li><li><strong>AI Model</strong>: gemini-1.5-flash</li><li><strong>Prompt</strong> (in Excel): <code>Write a 50-word product description for {productName}</code></li><li><strong>Field Selector</strong>: <code>#product-description</code></li></ul><h3 id="example-2-create-email-subject" tabindex="-1">Example 2: Create Email Subject <a class="header-anchor" href="#example-2-create-email-subject" aria-label="Permalink to ‚ÄúExample 2: Create Email Subject‚Äù">‚Äã</a></h3><p><strong>Configuration:</strong></p><ul><li><strong>AI Provider</strong>: OpenRouter</li><li><strong>AI Model</strong>: anthropic/claude-3-haiku</li><li><strong>Prompt</strong> (Default Value): <code>Generate a professional email subject for a meeting request</code></li><li><strong>Field Selector</strong>: <code>input[name=&quot;subject&quot;]</code></li></ul><h3 id="example-3-summarize-content" tabindex="-1">Example 3: Summarize Content <a class="header-anchor" href="#example-3-summarize-content" aria-label="Permalink to ‚ÄúExample 3: Summarize Content‚Äù">‚Äã</a></h3><p><strong>Configuration:</strong></p><ul><li><strong>AI Provider</strong>: Google - Gemini API</li><li><strong>AI Model</strong>: gemini-pro</li><li><strong>Prompt</strong> (in Excel): <code>Summarize this in 2 sentences: {longText}</code></li><li><strong>Field Selector</strong>: <code>.summary-field</code></li></ul><h2 id="use-cases" tabindex="-1">Use Cases <a class="header-anchor" href="#use-cases" aria-label="Permalink to ‚ÄúUse Cases‚Äù">‚Äã</a></h2><ul><li><strong>Content Generation</strong> - Create product descriptions, blog posts, or marketing copy</li><li><strong>Text Summarization</strong> - Condense long content into brief summaries</li><li><strong>Translation</strong> - Translate text between languages</li><li><strong>Data Transformation</strong> - Convert data formats or restructure information</li><li><strong>Creative Writing</strong> - Generate creative content, slogans, or taglines</li><li><strong>Email Composition</strong> - Create professional email subjects and bodies</li></ul><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to ‚ÄúBest Practices‚Äù">‚Äã</a></h2><h3 id="‚úÖ-do-s" tabindex="-1">‚úÖ Do&#39;s <a class="header-anchor" href="#‚úÖ-do-s" aria-label="Permalink to ‚Äú‚úÖ Do&#39;s‚Äù">‚Äã</a></h3><ul><li><strong>Be specific in prompts</strong> - Clear prompts generate better responses</li><li><strong>Test prompts first</strong> - Verify AI output quality before automation</li><li><strong>Use variables</strong> - Reference Excel columns with <code>{columnName}</code> syntax</li><li><strong>Set retry on error</strong> - Enable retry for better reliability</li><li><strong>Monitor API usage</strong> - Keep track of your API quota and costs</li></ul><h3 id="‚ùå-don-ts" tabindex="-1">‚ùå Don&#39;ts <a class="header-anchor" href="#‚ùå-don-ts" aria-label="Permalink to ‚Äú‚ùå Don&#39;ts‚Äù">‚Äã</a></h3><ul><li><strong>Don&#39;t use vague prompts</strong> - Unclear prompts lead to inconsistent results</li><li><strong>Don&#39;t exceed token limits</strong> - Keep prompts and expected outputs within model limits</li><li><strong>Don&#39;t share API keys</strong> - Keep your API credentials secure</li><li><strong>Don&#39;t ignore errors</strong> - Monitor and handle API errors appropriately</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to ‚ÄúTroubleshooting‚Äù">‚Äã</a></h2><h3 id="ai-output-not-filling" tabindex="-1">AI Output Not Filling <a class="header-anchor" href="#ai-output-not-filling" aria-label="Permalink to ‚ÄúAI Output Not Filling‚Äù">‚Äã</a></h3><p><strong>Solution:</strong> Verify the Field Selector Query is correct and the element exists on the page.</p><h3 id="api-key-error" tabindex="-1">API Key Error <a class="header-anchor" href="#api-key-error" aria-label="Permalink to ‚ÄúAPI Key Error‚Äù">‚Äã</a></h3><p><strong>Solution:</strong> Check that your API key is valid and has sufficient quota/credits.</p><h3 id="model-not-found" tabindex="-1">Model Not Found <a class="header-anchor" href="#model-not-found" aria-label="Permalink to ‚ÄúModel Not Found‚Äù">‚Äã</a></h3><p><strong>Solution:</strong> Verify the model name is correct for your selected provider.</p><h3 id="empty-response" tabindex="-1">Empty Response <a class="header-anchor" href="#empty-response" aria-label="Permalink to ‚ÄúEmpty Response‚Äù">‚Äã</a></h3><p><strong>Solution:</strong> Review your prompt for clarity and ensure it&#39;s appropriate for the AI model.</p><h2 id="related-documentation" tabindex="-1">Related Documentation <a class="header-anchor" href="#related-documentation" aria-label="Permalink to ‚ÄúRelated Documentation‚Äù">‚Äã</a></h2><ul><li><a href="/documentation/form-fields/field-types.html">Field Types</a></li><li><a href="/documentation/variable.html">Variables</a></li><li><a href="https://aistudio.google.com/" target="_blank" rel="noreferrer">Google AI Studio</a></li><li><a href="https://openrouter.ai/" target="_blank" rel="noreferrer">OpenRouter</a></li></ul>`,65)])])}const m=t(i,[["render",l]]);export{u as __pageData,m as default};
